// SPDX-License-Identifier: AGPL-3.0-only
pragma solidity 0.8.15;
import {GasMeasure} from "./utils/GasMeasure.sol";

contract SimpleTest is GasMeasure {

    function add1(uint256 a, uint256 b) public logs_gas returns (uint256) {
        if (a==0) {
            return 0;
        }

        uint256 c = a + b;
        return c;
    }

    function add2(uint256 a, uint256 b) public logs_gas returns (uint256 c) {
        if (a==0) {
            return 0;
        }

        c = a + b;
        return c;
    }

    function add3(uint256 a, uint256 b) public logs_gas returns (uint256) {
        if (a==0) {
            return 0;
        }

        return a + b;
    }
}

